import React from 'react'
const Requerimiento1 = () =>{
    
    const [equipo, setEquipo] = React.useState([])

    React.useEffect(() =>{
//console.log('useEffect')
obtenerDatos()
    }, [])
    const obtenerDatos = async () =>{
        const data = await fetch('http://localhost:8054/api/Primer-Requerimiento')
        const users = await data.json()
        setEquipo(users)
    }
return (
    <div>
        <h1 class="text-center text-primary">Requerimiento 1</h1>
        <table class="table  table-bordered stacktable table-sm">
    <thead>
      <tr class="table-primary">
        <th scope="col">Rut Decorador</th>
        <th scope="col">Nombre Decorador</th>
        <th scope="col">Direccion</th>
        <th scope="col">Cantidad de proyectos</th>
      </tr>
    </thead><tbody>
{
    equipo.map(item => (
    
      <tr>
        <th scope="row" key={item.id}>{item.rutDecorador}</th>
        <td>{item.decorador.primerNombre}  {item.decorador.segundoNombre} {item.decorador.primerApellido} {item.decorador.segundoApellido}</td>
        <td>{item.decorador.direccion}, {item.decorador.nombreCiudad}, {item.decorador.nombreRegion}</td>
        <td>{item.cantidad}</td>
      </tr>
     
  
    ))
}  </tbody>
  </table>

        
    </div>
)

}


export default Nosotros
